comment:
패치파 퍼블리파 어쩌구하는데 이건 지금 누가봐도 퍼블리가 그냥 잘 하고 있는거 아닌가..?
사이가 이미 엄청나게 틀어져있고 패치처럼 이대로 지나쳐버린다면 용사님은 산다 쳐도 두 도시의 감정의 골은 더 심해질거고 그럼 용검전설의 다음은 절대 없게 될텐데. 이대로 용사님이 게임 끝까지 가서 엔딩을 본 뒤 다시 새로운 용사님이 오셨을 때 게임을 이끌어갈 수가 없을테니까. 애초의 패치가 매뉴얼을 숙지하지 못 한 채 용검을 삭제해버렸기 때문에 지엠이 엔딩까지 책임지고 가라고 한 거였잖아; 
그리고 저번에 패치보고 누군가 진심을 말하고 있지 않다고 말했다. 패치도 사실은 알고있는거야. 이대로 지나치면 다음은 없다는걸, 또 패치 본인도 사람들의 마음을 무시하고 싶지 않다는걸.
